import React from 'react';
import ReactDOM from 'react-dom';
import add from "./Calc";
ReactDOM.render(
    <>
     <ul>
         <li>The Addition of two number is{add(40,4)}</li>
         <li>{Sub(30,2)}</li>
         <li>{Mult(25,4)}</li>
         <li>{Div(50,5)}</li>

     </ul>
    </>,
    document.getElementById("root")

);
